If enough of us STOP being just consumers and start to share, things get a bit better, yeah? Love to you all..

NOW TO THIS UPLOAD! I just had to let this one out too. I make the assumption based upon what I see before my very eyes and common reasoning that time is very short now, and I need to get this information out to as many as possible before it's too late. They'll soon close this window we call &quot;file-sharing&quot;, and it will re-emerge in quite other forms than the open exchange of information we are currently lucky enough to live under. This will change, and that soon.

Therefore I make this upload of a movie by the Archaeologist Jonathan Gray, where he goes through the Zodiac and the names of the stars that make up the Zodiac and a whole lot more, and the conclusions you may reach by watching this could actually change your perspective on things and the world in general.

Things are rarely what they seem, and almost never like we've been led to think by the mainstream media.. Be it TV or other &quot;scholars&quot; and &quot;teachers&quot; or &quot;gurus&quot;..

This one's a real goodie, although it's just a digitalized copy of a VHS with him and a silver screen, in all simplicity, but that is enough to get the message through. It will certainly shake the foundations whereupon the art of Astrology is built, and change the philosophical views behind it too.
And J. Gray has a lot of other goodies in his storage chamber, so if you're financially able, you should really consider buying some of his books or DVD-sets. He's got some new ones out now, so I'm just uploading some of the old ones.

Jonathan Gray's website is at: &lt;a href=&quot;
http://www.beforeus.com&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.beforeus.com&lt;/a&gt;

and there you can prescribe to his newsletter, and with them come offers the general public has no access to. If you're financially able.

J. Gray is not a wealthy man. He has sold his house, and rents a house to live in with his wife, and all of his income are from selling his DVDs and books, and he uses it to go excavating and trying to get to the truth about Biblical accounts, and some of what he's found can only be described as no less than mind-blowing.

I recommend strongly the book; &quot;Dead Mens Secrets&quot;. Evidence of an ancient, world wide and highly sophisticated civilization, which suddenly emerged and just as suddenly disappeared.
The Proof includes findings of the skeletons of giant Human beings, 6-10 meters tall, ancient intricate machinery, technology we haven't been able to duplicate or figure out still today.. So if you can afford it, buy something. If not, you can download this movie at least, from here, free.
And maybe I'll let out some more in a while.. I said maybe.
No, I'm only kidding. I will in all probability upload some more soon.. :)

